import styles from "./SkillsList.module.scss";

export const SkillsList = () => {
  return (
    <div className={styles.skills_list}>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faHtml5} size="2x" />
        <i class="fab fa-html5 fa-4x icon"></i>
      </div>
      <div className={styles.skills_list_icon}>
        <i class="fab fa-css3-alt fa-4x icon"></i>
      </div>
      <div className={styles.skills_list_icon}>
        <i class="fab fa-sass fa-4x icon"></i>
      </div>
      <div className={styles.skills_list_icon}>
        <i class="fab fa-js-square fa-4x icon"></i>
      </div>
      <div className={styles.skills_list_icon}>
        <i class="fab fa-github-square fa-4x icon"></i>
      </div>
    </div>
  );
};
